import React,{useState,useEffect,selectChange,cardSelector,Component} from 'react';
import {Button} from '@material-ui/core';
import { Link } from 'react-router-dom';
import Navbar1 from './Navbar1';
import Menu1 from './Menu1';
import Device from './Device';
import icon1 from './images/icon1a.svg';
import icon2 from './images/icon2p.svg';
import icon3 from './images/icon3p.svg';
import Grid from '@material-ui/core/Grid';
import { Card, CardMedia, CardContent, CardActions, IconButton,CardHeader,Avatar } from '@material-ui/core';
import MoreVertIcon from '@material-ui/icons/MoreVert';
import './style.css';
import { Menu } from '@material-ui/icons';
import { DatePickerComponent } from '@syncfusion/ej2-react-calendars';

  

class Report extends Component {
    constructor() {
        super(...arguments);
        this.minDate = new Date(new Date().getFullYear(), new Date().getMonth(), 7);
        this.maxDate = new Date(new Date().getFullYear(), new Date().getMonth(), 27);
        this.dateValue = new Date(new Date().getFullYear(), new Date().getMonth(), 14);
    }

  render(){

  return (
    
    <div>
        <Navbar1/>
        <div className="container4">
        <Menu1/>
        <Device/>
        <div className="report">
          <h3>Generate Report</h3>
            <div className="container7">
            <a className="p3">Select the devices you wish to generate reports.</a>
            <div className='control-pane'>
                <div className='control-section'>
                    <div className='datepicker-control-section'>
                    <DatePickerComponent id="calendar" min={this.minDate} max={this.maxDate} value={this.dateValue}></DatePickerComponent>
                    </div>
                </div>
            </div>
            </div>
        </div>
        </div>
    </div>
  );
            }
};

export default Report;
